#include <iostream>
#include <algorithm>
#include <vector>
#include <sys/time.h>      //添加头文件
using namespace std;

int64_t getCurrentTime()      //直接调用这个函数就行了，返回值最好是int64_t，long long应该也可以
{
    struct timeval tv;
    gettimeofday(&tv,NULL);    //该函数在sys/time.h头文件中
    return tv.tv_sec * 1000 + tv.tv_usec / 1000;
}

class Solution {
public:
    string minWindow(string s, string t) {
        if (t.length() == 0) return "";
        vector<int> target(256, 0);
        vector<int> temp(256, 0);
        for (int i = 0; i < t.length(); ++i) {
            target[t[i]]++;
        }
        int start_t = 0, start = 0;
        int width = s.length()+1; int h = 0;
        for (int i = 0; i < s.length(); ++i) {
            temp[s[i]]++;
            if (temp[s[i]] <= target[s[i]]) {
                h++;
            }
            if (h == t.length()) {
                while (start_t < i && temp[s[start_t]]>target[s[start_t]]) {
                    temp[s[start_t]]--;
                    start_t++;
                } // 此时start_t在窗口开始位置
                if (i-start_t+1 < width) {
                    width = i-start_t+1;
                    start = start_t;
                }
                temp[s[start_t]]--;
                start_t++;
                h--;
            }
        }
        if (width == s.length()+1) return "";
        return s.substr(start, width);
    }
};

int main()
{
    Solution a;
    int64_t t = getCurrentTime();
    cout<<a.minWindow("", "");
//    cout<<a.minWindow("bba", "ab");
    cout<<endl;
    cout<<getCurrentTime()-t<<endl;
    return 0;
}
